import React from 'react'
import './Header.css';

const Header=({approvers, quorum})=> (
        <div classname="approve">
            <div>Approvers:</div>
            <p classname="approve">{approvers.join(', ')}</p>
            <div>Quorum:{quorum.toNumber()}</div>
        </div>
    )


export default Header
